  false,\n\t\"url\": null,\n\t\"notes\": \"St. George Island SGI is a significant
  sea turtle nesting beach for loggerhead and occasionally leatherback sea turtles
  in the Florida panhandle Lewis et al 1996 . Loggerhead sea turtles are a threatened
  species and leatherback sea turtles are endangered. Both are protected by state
  and federal laws. Artificial lighting has negative impacts on both nesting and hatchling
  sea turtles Witherington and Martin 1996, NMFS and USFWS 1991. Many sources of artificial
  beach lighting exist on SGI.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
